import React, { useEffect, useState } from "react";
import axios from "axios";

function News() {
  const [headlines, setHeadlines] = useState("");
  const [everything, setEverything] = useState("");

  useEffect(() => {
    async function fetchNews() {
      const responseHeadlines = await axios.get(
        "http://newsapi.org/v2/top-headlines?country=us&q=covid&apiKey=845e6a63d3314b6d9d81f5d77f1b9764"
      );
      const responseEverything = await axios.get(
        "http://newsapi.org/v2/everything?q=covid&sortBy=popularity&apiKey=845e6a63d3314b6d9d81f5d77f1b9764"
      );
      console.log("hello news");
      //console.log(response.data.articles[0].content);
      console.log(responseHeadlines.data.articles[0]);
      console.log(responseEverything.data);

      setHeadlines(responseHeadlines.data);
    }
    fetchNews();
  }, []);
  return <div></div>;
}

export default News;
